SBA CONTRACT REFERENCE # IS 0353.14.400315.

THE PURPOSES OF THIS ADMINISTRATIVE MODIFICATION TO HSTS03-14-C-CIO456 ARE:

1) TO ADD THE MANDATORY CLAUSE HSAR 3052.209-73 "LIMITATION ON FUTURE CONTRACTING" (JUN 2006) INTO SECTION I.2 OF THE CONTRACT; 

2) TO CORRECT SECTION G.3 - 4202.242.002 "SUBMISSION OF INVOICES" (AUG 2013) TO UPDATE THE INVOICE ELEMENTS AND FREQUENCY OF INVOICE SUBMISSION SECTIONS WITH MORE COMPLETE INSTRUCTIONS; 

3) TO CORRECT SECTION H.23 - 5201.204-002 "NOTIFICATION OF CLASSIFIED CONTRACT" (AUG 2013) TO REMOVE INACCURATE REFERENCES TO CLASSIFIED INFORMATION AND PLACE OF PERFORMANCE; 

4) TO UPDATE SECTION I.2. - FAR 52.219-12 "SPECIAL 8(A) SUBCONTRACT CONDITIONS" (FEB 1990) TO INCOROPATE THE CONTRACT NUMBER INTO (A) AND INTO (B)(1); AND 

5) TO INCORPORATE "LABOR CATEGORY DESCRIPTIONS" AS ATTACHMENT B INTO SECTION J OF THE AWARD DOCUMENT.

ALL OTHER TERMS AND CONDITIONS REMAIN UNCHANGED.
